*, *:before, *:after 
  box-sizing inherit
  -webkit-tap-highlight-color transparent
  -moz-tap-highlight-color transparent
html, body, #q-app
  width 100%
  direction ltr
html, body
  margin 0
  box-sizing border-box
input[type='text'], input[type='email'], input[type='search'], input[type='password']
  -webkit-appearance none
  -moz-appearance none /* mobile firefox too! */
article,
aside,
details,
figcaption,
figure,
footer,
header,
main,
menu,
nav,
section,
summary
  display block
audio:not([controls])
  display none
  height 0
abbr[title]
  border-bottom none 
  text-decoration underline 
  text-decoration underline dotted 
dfn
  font-style italic
img
  border-style none
svg:not(:root)
  overflow hidden
code, kbd, pre, samp
  font-family monospace, monospace 
  font-size 1em 
hr
  box-sizing content-box 
  height 0 
  overflow visible 
button,
input,
select,
textarea
  font inherit
  margin 0
optgroup
  font-weight bold
button,
input, 
select 
  overflow visible
button::-moz-focus-inner, input::-moz-focus-inner
  border 0
  padding 0
button:-moz-focusring, input:-moz-focusring
  outline 1px dotted ButtonText
textarea
  overflow auto
input[type='search']
  -webkit-appearance textfield
input[type='search']::-webkit-search-cancel-button,
input[type='search']::-webkit-search-decoration
  -webkit-appearance none
.q-icon
  line-height 1
  letter-spacing normal
  text-transform none
  white-space nowrap
  word-wrap normal
  direction ltr
.q-icon, .material-icons
  user-select none
  cursor inherit
  font-size inherit
  display inline-flex
  align-items center
  justify-content center
  vertical-align middle
.q-actionsheet-title
  min-height 56px
  padding 0 16px
  color $faded
  color var(--q-color-faded)
.q-actionsheet-body
  max-height 500px
.q-actionsheet-grid
  padding 8px 16px
  .q-item-separator-component
    margin 24px 0
.q-actionsheet-grid-item
  padding 8px 16px
  transition background .3s
  &:hover, &:focus
    background $action-sheet-hover-background
    outline 0
  i, img
    font-size 48px
    margin-bottom 8px
  .avatar
    width 48px
    height 48px
  span
    color $faded
    color var(--q-color-faded)
.q-loading-bar
  position fixed
  z-index $z-max
  transition transform .5s cubic-bezier(0, 0, .2, 1), opacity .5s
  &.top
    left 0 /* rtl:ignore */
    right 0 /* rtl:ignore */
    top 0
    width 100%
  &.bottom
    left 0 /* rtl:ignore */
    right 0 /* rtl:ignore */
    bottom 0
    width 100%
  &.right
    top 0
    bottom 0
    right 0
    height 100%
  &.left
    top 0
    bottom 0
    left 0
    height 100%
.q-alert
  border-radius $generic-border-radius
  box-shadow none
  .avatar
    width 32px
    height 32px
.q-alert-side, .q-alert-content
  padding 12px
  font-size 16px
  word-break break-word
.q-alert-side
  font-size 24px
  background rgba(0, 0, 0, .1)
.q-alert-actions
  padding 12px 12px 12px 0
.q-alert-detail
  font-size 12px
body.desktop .q-select-highlight
  background $item-highlight-color !important
.q-breadcrumbs
  .q-icon, .q-breadcrumbs-separator
    font-size 150%
.q-breadcrumbs-last a
  pointer-events none
[dir=rtl] .q-breadcrumbs-separator .q-icon
  transform scaleX(-1) /* rtl:ignore */
.q-btn
  outline 0
  border 0
  vertical-align middle
  cursor pointer
  padding $button-padding
  font-size $button-font-size
  text-decoration none
  color inherit
  background transparent
  transition $button-transition
  min-height 2.572em
  box-shadow $button-shadow
  font-weight $button-font-weight
  text-transform uppercase
  button&
    -webkit-appearance button
  a&
    display inline-flex
  .q-icon, .q-spinner
    font-size 1.4em

  .q-btn-inner:before
    content ''
  &.disabled
    opacity .7 !important
  &:not(.disabled):not(.q-btn-flat):not(.q-btn-outline):not(.q-btn-push)
    &:before




      content ''
      position absolute
      top 0
      right 0
      bottom 0
      left 0
      border-radius inherit
      z-index -1
      transition $button-transition
    &:active:before
    &.active:before
      box-shadow $button-shadow-active
.q-btn-progress
  transition all .3s
  height 100%
  background rgba(255, 255, 255, .25)
  &.q-btn-dark-progress
    background rgba(0, 0, 0, .2)
.q-btn-no-uppercase
  text-transform none
.q-btn-rectangle
  border-radius $button-border-radius
.q-btn-outline
  border 1px solid currentColor
  background transparent !important
.q-btn-push
  border-radius $button-push-border-radius
  border-bottom 3px solid rgba(0, 0, 0, .15)
  &:active:not(.disabled)
  &.active:not(.disabled)
    box-shadow none
    transform translateY(3px)
    border-bottom-color transparent
  .q-focus-helper, .q-ripple-container
    height auto
    bottom -3px
.q-btn-rounded
  border-radius $button-rounded-border-radius
.q-btn-round
  border-radius 50%
  padding 0
  min-height 0
  height 3em
  width 3em
.q-btn-flat, .q-btn-outline
  box-shadow none
.q-btn-dense
  padding $button-dense-padding
  min-height 2em
  &.q-btn-round
    padding 0
    height 2.4em
    width 2.4em
  .on-left
    margin-right 6px
  .on-right
    margin-left 6px
.q-btn-fab, .q-btn-fab-mini
  .q-icon
    font-size 24px
.q-btn-fab
  height 56px
  width 56px
.q-btn-fab-mini
  height 40px
  width 40px
.q-btn-dropdown-split .q-btn-dropdown-arrow
  padding 0 4px
  border-left 1px solid rgba(255, 255, 255, .3)
.q-btn-group
  border-radius $button-border-radius
  box-shadow $button-shadow
  vertical-align middle
  > .q-btn-item
    box-shadow none
  > .q-btn-group
    > .q-btn:first-child
      border-top-left-radius inherit
      border-bottom-left-radius inherit
    > .q-btn:last-child
      border-top-right-radius inherit
      border-bottom-right-radius inherit
  > .q-btn-group:not(:first-child) > .q-btn:first-child
    border-left 0
  > .q-btn-group:not(:last-child) > .q-btn:last-child
    border-right 0
  > .q-btn-item:not(:last-child)
    border-top-right-radius 0
    border-bottom-right-radius 0
  > .q-btn-item + .q-btn-item
    border-top-left-radius 0
    border-bottom-left-radius 0
.q-btn-group-push
  border-radius $button-push-border-radius
  > .q-btn-push
    .q-btn-inner
      transition $button-transition
    &:active:not(.disabled)
    &.active:not(.disabled)
      border-bottom-color rgba(0, 0, 0, .15)
      transform translateY(0)
      .q-btn-inner
        transform translateY(3px)
.q-btn-group-rounded
  border-radius $button-rounded-border-radius
.q-btn-group-flat, .q-btn-group-outline
  box-shadow none
.q-btn-group-outline
  > .q-btn-item + .q-btn-item
    border-left 0
  > .q-btn-item:not(:last-child)
    border-right 0
.q-card
  border-radius $generic-border-radius
  box-shadow $card-shadow
  vertical-align top
  > div:first-child
    border-top-left-radius inherit
    border-top-right-radius inherit
  > div:last-child
    border-bottom-left-radius inherit
    border-bottom-right-radius inherit
  > .q-list
    border 0
.q-card-separator
  background $card-separator-color
  height 1px
  &.inset
    margin 0 16px
.q-card-container
  padding 16px
.q-card-title
  font-size 18px
  font-weight 400
  letter-spacing normal
  line-height 2rem
  &:empty
    display none
.q-card-subtitle, .q-card-title-extra
  font-size 14px
  color $card-faded-color
  .q-icon
    font-size 24px
.q-card-main
  font-size 14px
.q-card-primary + .q-card-main
  padding-top 0
.q-card-actions
  padding 8px
  .q-btn
    padding 0 8px
.q-card-actions-horiz
  .q-btn + .q-btn
    margin-left 8px
.q-card-actions-vert
  .q-btn + .q-btn
    margin-top 4px
.q-card-media
  overflow hidden
  > img
    display block
    width 100%
    max-width 100%
    border 0
.q-card-media-overlay
  color white
  background $card-overlay-color
  .q-card-subtitle
    color white
.q-card-dark
  .q-card-separator
    background $card-dark-separator-color
  .q-card-subtitle, .q-card-title-extra
    color $card-dark-faded-color
.q-carousel
  overflow hidden
  position relative
.q-carousel-inner
  position relative
  height 100%
.q-carousel-slide
  flex 0 0 100%
  margin 0
  padding $carousel-padding
.q-carousel-track
  padding 0
  margin 0
  will-change transform
  display flex
  flex-wrap nowrap
  height 100%
  &.infinite-left > div:nth-last-child(2)
    order -1000
    margin-left -100%
  &.infinite-right > div:nth-child(2)
    order 1000
.q-carousel-left-arrow,
.q-carousel-right-arrow
  top 50%
  transform translateY(-50%)
  background $carousel-quick-nav-background
.q-carousel-left-arrow
  left 5px
.q-carousel-right-arrow
  right 5px
.q-carousel-quick-nav
  padding 2px 0
  background $carousel-quick-nav-background
  .q-icon
    font-size $carousel-quick-nav-icon-font-size !important
  .q-btn.inactive
    opacity .5
    .q-icon
      font-size $carousel-quick-nav-icon-inactive-font-size !important
.q-carousel-thumbnails
  will-change transform
  transition transform .3s
  transform translateY(105%)
  width 100%
  height auto
  max-height 60%
  overflow auto
  background black
  padding .5rem
  text-align center
  box-shadow 0 -3px 6px rgba(0, 0, 0, .16), 0 -5px 6px rgba(0, 0, 0, .23)
  &.active
    transform translateY(0)
  img
    height auto
    width 100%
    display block
    opacity .5
    will-change opacity
    transition opacity .3s
    cursor pointer
    border 1px solid black
  > div > div
    flex 0 0 108px
    &.active img, img.active
      opacity 1
      border-color white
.q-carousel-thumbnail-btn
  background $carousel-quick-nav-background
  top 5px
  right 5px
body.desktop .q-carousel-thumbnails img:hover
  opacity 1
.q-message-name, .q-message-stamp, .q-message-label
  font-size small
.q-message-label
  margin (3 * $chat-message-distance) 0
.q-message-stamp
  color inherit
  margin-top 4px
  opacity .6
  display none
.q-message-avatar
  border-radius 50%
  width $chat-message-avatar-size
  height $chat-message-avatar-size
.q-message
  margin-bottom $chat-message-distance
  &:first-child .q-message-label
    margin-top 0
.q-message-received
  .q-message-avatar
    margin-right 8px
  .q-message-text
    color $chat-message-received-bg
    border-radius $chat-message-border-radius $chat-message-border-radius $chat-message-border-radius 0
    &:last-child:before
      right 100%
      border-right 0 solid transparent
      border-left 8px solid transparent
      border-bottom 8px solid currentColor
  .q-message-text-content
    color $chat-message-received-color
.q-message-sent
  .q-message-name
    text-align right
  .q-message-avatar
    margin-left 8px
  .q-message-container
    flex-direction row-reverse
  .q-message-text
    color $chat-message-sent-bg
    border-radius $chat-message-border-radius $chat-message-border-radius 0 $chat-message-border-radius
    &:last-child:before
      left 100%
      border-left 0 solid transparent
      border-right 8px solid transparent
      border-bottom 8px solid currentColor
  .q-message-text-content
    color $chat-message-sent-color
.q-message-text
  background currentColor
  padding $chat-message-text-padding
  line-height max(1.2, $min-line-height)
  word-break break-word
  position relative
  transform translate3d(0, 0, 0)
  & + &
    margin-top 3px
  &:last-child
    min-height $chat-message-avatar-size
    .q-message-stamp
      display block
    &:before
      content ''
      position absolute
      bottom 0
      width 0
      height 0
$checkbox-size = 21px
.q-checkbox-icon
  height $checkbox-size
  width $checkbox-size
  font-size $checkbox-size
  opacity 0
.q-chip
  min-height $chip-height
  max-width 100%
  padding $chip-padding-horizontal $chip-padding-vertical
  font-size $chip-font-size
  border $chip-border
  border-radius $chip-border-radius
  vertical-align middle
  color $chip-color
  background $chip-background
  &:focus .q-chip-close
    opacity .8
  .q-icon
    font-size $chip-icon-size
    line-height 1
.q-chip-main
  line-height initial
  flex 1 1 auto
.q-chip-side
  border-radius 50%
  height $chip-height
  width $chip-height
  min-width $chip-height
  overflow hidden
  img
    width 100%
    height 100%
.q-chip-left
  margin-left -12px
  margin-right 8px
.q-chip-right
  margin-left 2px
  margin-right -12px
.q-chip-square
  border-radius 2px
.q-chip-floating
  position absolute
  top -.3em
  right -.3em
  pointer-events none
.q-chip-tag
  position relative
  padding-left 1.7rem
  &:after
    content ''
    position absolute
    top 50%
    left .5rem
    margin-top -.25rem
    background white
    width .5rem
    height .5rem
    box-shadow 0 -1px 1px 0 rgba(0, 0, 0, .3)
    border-radius 50%
.q-chip-pointing
  position relative
  z-index 0
  &:before
    content ''
    z-index -1
    background inherit
    width 16px
    height 16px
    position absolute
.q-chip-pointing-up
  margin-top .8rem
  &:before
    top 0
    left 50%
    transform translateX(-50%) translateY(-22%) rotate(45deg)
.q-chip-pointing-down
  margin-bottom .8rem
  &:before
    right auto
    top 100%
    left 50%
    transform translateX(-50%) translateY(-78%) rotate(45deg)
.q-chip-pointing-right
  margin-right .8rem
  &:before
    top 50%
    right 2px
    bottom auto
    left auto
    transform translateX(33%) translateY(-50%) rotate(45deg)
.q-chip-pointing-left
  margin-left .8rem
  &:before
    top 50%
    left 2px
    bottom auto
    right auto
    transform translateX(-33%) translateY(-50%) rotate(45deg)
.q-chip-detail
  background rgba(0, 0, 0, .1)
  opacity .8
  padding 0 5px
  border-radius inherit
  border-top-right-radius 0
  border-bottom-right-radius 0
.q-chip-small
  min-height $chip-small-height
  .q-chip-main
    padding 4px 1px
    line-height initial
  .q-chip-side
    height $chip-small-height
    width $chip-small-height
    min-width $chip-small-height
  .q-chip-icon
    font-size $chip-small-icon-size
.q-chip-dense
  min-height 1px
  padding 0 3px
  font-size 12px
  &.q-chip-tag
    padding-left 1.3rem
  &.q-chip-pointing:before
    width 9px
    height 9px
  .q-chip-main
    padding 1px
  .q-chip-side
    height 18px
    width 18px
    min-width 16px
    font-size 14px
  .q-chip-left
    margin-left -3px
    margin-right 2px
  .q-chip-right
    margin-left 2px
    margin-right -2px
  .q-icon
    font-size 16px
.q-input-chips
  margin-top -6px
  margin-bottom -6px
  input.q-input-target
    min-width 70px !important
.q-collapsible-sub-item
  padding $collapsible-padding
  &.indent
    padding-left $collapsible-menu-left-padding
    padding-right 0
  .q-card
    margin-bottom 0
.q-collapsible.{$router-link-active} > .q-item
  background $collapsible-active-color
.q-collapsible
  transition padding .5s
.q-collapsible-popup-closed
  padding 0 15px
  .q-collapsible-inner
    border 1px solid $item-separator-color
  & + &
    .q-collapsible-inner
      border-top 0
.q-collapsible-popup-opened
  padding 15px 0
  .q-collapsible-inner
    box-shadow $shadow-2
  & + &, &:first-child
    padding-top 0
  &:last-child
    padding-bottom 0
.q-collapsible-cursor-pointer > .q-collapsible-inner > .q-item
